import React from 'react';
import styles from './TVlist.module.css';

const TVlist = ({ tvs }) => {
  const renderTVs = () => {
    return tvs.map((tv) => {
      return (
        <li key={tv.id} className={styles.moviecard}>
          <div className={styles.img}>
            <img
              className={styles.img__poster}
              src={`https://image.tmdb.org/t/p/original${tv.poster_path}`}
              alt=""
            />
          </div>
          <p className={styles.title}>{tv.original_name}</p>
          <p className={styles.date}>{tv.first_air_date}</p>
        </li>
      );
    });
  };

  return <React.Fragment>{renderTVs()}</React.Fragment>;
};

export default TVlist;
